{
   "tailf-ncs:devices": {
     "template": [
       {
         "name": "ct-color-131-7ms",
         "ned-id": [
           {
             "id": "cisco-iosxr-cli-7.52:cisco-iosxr-cli-7.52",
             "config": {
               "tailf-ned-cisco-ios-xr:segment-routing": {
                 "traffic-eng": {
                   "on-demand": {
                     "color": [
                       {
                         "id": "131",
                         "dynamic": {
                           "bounds": {
                             "cumulative": {
                               "type": [
                                 {
                                   "name": "latency",
                                   "value": "7000"
                                 }
                               ]
                             }
                           }
                         }
                       }
                     ]
                   }
                 }
               }
             }
           }
         ]
       },
       {
         "name": "ct-color-131-pm",
