           {
             "id": "cisco-iosxr-cli-7.52:cisco-iosxr-cli-7.52",
             "config": {
               "tailf-ned-cisco-ios-xr:performance-measurement": {
                 "delay-profile": {
                   "name": [
                     {
                       "name": "2wayDelay",
                       "advertisement": {
                         "anomaly-check": {
                         },
                         "periodic": {
                           "minimum-change": "1000",
                           "interval": "60",
                           "threshold": "20"
                         }
                       },
                       "probe": {
                         "tx-interval": "30000",
                         "measurement-mode": "one-way",
                         "protocol": "twamp-light",
                         "computation-interval": "60"
                       }
                     }
                   ]
                 }
               }
             }
           }
         ]
       }
     ]
   }
 }

